import React from 'react'

function Movie() {
    return (
        <div>
            <img src={this.props.Poster}/>
                <h2>${this.props.Title}</h2>
                <ul class="list-group">
            {/* <li class="list-group-item"><strong>Year released:</strong>{this.props.Year}</li> */}
            <li class="list-group-item"><strong>Type:</strong>{this.props.Type}</li>
            <li class="list-group-item"><strong>Imdb ID:</strong>{this.props.imdbID}</li>
            <li class="list-group-item"><strong>IMDB page:</strong><a href='https://www.imdb.com/title/${input.imdbID}/' target='_blank'> Home page</a></li>
          </ul>
        </div>
    )
}

export default Movie
